import React from "react";


function Add(first,second){
    return(
       first+second 
    );
}
function Sub(first,second){
    return(
        first-second
    );

}
let result;
function Div(first,second){
    return(
        result=first/second  
    )
}

export default Add;
export {Sub};
export {Div};
